import React from "react";
import react from "react";
import styled from "styled-components";

function Nav() {
  return (
    <React.Fragment>
      <NavContainer>
        <LogoContainer>
          <h1>Logo</h1>
        </LogoContainer>
        <MenuItemsContainer></MenuItemsContainer>
      </NavContainer>
    </React.Fragment>
  );
}

export default Nav;
const NavContainer = styled.div``;

const LogoContainer = styled.div``;

const MenuItemsContainer = styled.div``;
